import styles from '../Something.module.css';
import { Outlet, Link } from 'react-router-dom';

const Podcasts = () => {
  return (
    <div className={styles.podcast_height}>
      <div className={styles.movie_bg}>
        <div className="row h-100">
          <div className="col-8 align-self-center">
            <h3 className="text-light">
              In addition to being a movie connoisseur, Joel Hilton also hosts a
              successful Podcast, titled "Baconsale."
            </h3>
            <h3>Check it out here:</h3>
            <Link to={{ pathname: 'https://baconsale.com/' }} target="_blank">
              Baconsale.
            </Link>
          </div>
        </div>
      </div>
    </div>
  );
};

export default Podcasts;
